-font-weight:normal\">Jistě se všichni\r\nshodneme, že povolání profesionálního cyklisty je jedna z nejtěžších profesí,\r\nkterou člověk může vykonávat. Na to, aby se člověk stal profíkem, musí trénovat\r\na závodit v jakémkoliv počasí, třeba i v dešti. A právě to byl případ i dnešní\r\ntřetí etapy italského etapového závodu Tirreno Adriatico. Za hustého deště\r\nzávodníci na kole strávili přes 6 hodin. Jako první dnes cílovou pásku protnul\r\nAndrea Vendreame, který zvítězil ve sprintu menší skupiny.</b></p>\r\n\r\n<p class=\"MsoNormal\">Třetí etapa italského závodu Tirreno Adriatico startovala v\r\nToskánském městě Follonica. Z něj se <b style=\"mso-bidi-font-weight:normal\">závodníci\r\nvydali na 239km dlouhou trasu se zvlněným profilem</b>. Jednalo se o nejdelší\r\netapu letošního ročníku tohoto italského závodu. <b style=\"mso-bidi-font-weight:\r\nnormal\">Závěr etapy zpestřilo 18km dlouhé stoupání.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">Za nepřetržitého deště se úvod třetí etapy vyvíjel\r\nprazvláštně. Závodníci spíše zápolili s&nbsp;deštěm, než aby se porovnávali\r\nmezi sebou. <b style=\"mso-bidi-font-weight:normal\">Slibný únik se tak vytvořil\r\naž 66km před cílem. </b>Do úprku před hlavní skupinu se vydal <b style=\"mso-bidi-font-weight:normal\">Belgičan Dries de Bondt společně s Italem\r\nAndreou Pietrobonem</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Tento pokud zprvu vypadal jako beznadějný. Pak se ale\r\npeloton začal přibližovat k cílovému stoupání. Každý tým se v pelotonu chtěl\r\nposunout na výhodnou pozici, což <b style=\"mso-bidi-font-weight:normal\">přineslo\r\ndo hlavní skupiny nervozitu</b>. To v&nbsp;kombinaci s deštěm přineslo pád, do\r\nnějž se přimotal i Jonathan Milan, který patřil mezi favority dojezdu. Z&nbsp;toho\r\n<b style=\"mso-bidi-font-weight:normal\">profitovali závodníci v&nbsp;úniku</b>,\r\njelikož peloton na chvíli zpomalil.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Peloton po několika hektických kilometrech najížděl do\r\ncílového kopce s více než minutovým mankem na únik. Vrchol o<b style=\"mso-bidi-font-weight:normal\">smnáctikilometrového kopce Valico di\r\nColfiorito se nacházel pouze 3 kilometry před dojezdem</b>. Nejedná se ale o\r\nnijak náročný kopec, jelikož jeho průměrný sklon činí jen 3 %.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Náskok uprchlíků\r\nhlavní skupina smazala až zhruba v polovině cílového kopce</b>. Poté\r\nnásledovalo hned několik útoků z hlavní skupiny. O nadělení pelotonu se pokusil\r\nBen Helay, Richard Carapaz a dokonce i Juan Ayuso. Ani jeden z nástupů ale\r\nneuspěl, <b style=\"mso-bidi-font-weight:normal\">takže po přejetí kopce se\r\nhlavní skupina skládala z&nbsp;50ti závodníků.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">Prakticky ihned <b style=\"mso-bidi-font-weight:normal\">za\r\nhorizontem všechny zaskočil útokem Filippo Ganna</b>. Ten si rychle vytvořil\r\nmalý náskok. Ital jako velmi dobrý časovkář velmi potrápil všechny závodníky. <b style=\"mso-bidi-font-weight:normal\">Hlavní skupině trvalo celé dva kilometry\r\nnež Gannu dojeli</b>. Ruku k dílu musel přiložit i Mathieu van der Poel.</p><p class=\"MsoNormal\"><p></p><div class=\"iframe\"><blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"it\" dir=\"ltr\">🔻 A hectic run to the line after a treacherous day on the bike<br><br>🔻 Un finale frenetico al culmine di una dura giornata in sella<br><br>⏪ The <a href=\"https://twitter.com/continentaltire?ref_src=twsrc%5Etfw\">@continentaltire</a> Ultimo Kilometro ⤵️<a href=\"https://twitter.com/hashtag/TirrenoAdriatico?src=hash&amp;ref_src=twsrc%5Etfw\">#TirrenoAdriatico</a> <a href=\"https://twitter.com/CA_Ita?ref_src=twsrc%5Etfw\">@CA_Ita</a> <a href=\"https://t.co/SMeg1k6ncx\">pic.twitter.com/SMeg1k6ncx</a></p>— Tirreno Adriatico (@TirrenAdriatico) <a href=\"https://twitter.com/TirrenAdriatico/status/1899883091021238570?ref_src=twsrc%5Etfw\">March 12, 2025</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script> </div></p>\r\n\r\n<p class=\"MsoNormal\">Nejdelší etapa letošního ročníku nakonec skončila hromadným\r\ndojezdem. V <b style=\"mso-bidi-font-weight:normal\">něm nejlépe své vsazení\r\nnačasoval Andrea Vendrame</b>, který porazil i druhého Pidcocka a třetího\r\nGregóira. <b style=\"mso-bidi-font-weight:normal\">Filippo Ganna i po třetí etapě\r\nzůstává celkovým lídrem závodu.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><img src=\"data:image/png;base64,\" alt=\"\"><br></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Myslíte si, že Ganna\r\novládne celkové pořadí?</b></p>\r\n\r\n<div><br></div><div><br></div>', 6, 'v-destive-treti-etape-tirrena-adriatica-zaskocil-vsechny-favority-ital-vendrame');